import React, {Component} from 'react';
//import {Router, Link} from "react-router-dom";
import {Row} from "react-bootstrap";
import {Col} from "react-bootstrap";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faHeart, faPhone, faAddressBook, faUser  } from '@fortawesome/free-solid-svg-icons';

class HeaderLinks extends Component {
    render() {
        return (
            <Row className={'mt-1 mb-1 header-links'}>
                <Col className={'text-right'} xs={12}>
                    <a href="#" className={'pl-3'}>Siparişlerim</a>
                    <a href="#" className={'pl-3'}>Kargo Takip</a>
                    <a href="#" className={'pl-3'}>Hediye Çeklerim</a>
                    <a href="#" className={'pl-3'}>Yardım</a>
                    <a href="#" className={'pl-3'}>Bize Sorun</a>
                </Col>
            </Row>
        );
    }
}

export default HeaderLinks;
